import React from "react";

export default function SearchMovies() {
  return (
    <div>
      <form className="form">
        <label className="label" htmlFor="query">
          Movie Name
        </label>
        <input type="text" name="query"></input>
        <button className="button" type="submit">
          Query
        </button>
      </form>
    </div>
  );
}
